comment.en:
Act of carrying out a Procedure. Links to:

- a Procedure Executor to describe what made it and how; 
- the used procedure;
- the command and the result of the procedure execution (simple or complex).

An observable or operable Quality of an Event or Object. That is, not a quality of an abstract entity as is also allowed by DUL's Quality, but rather an aspect of an entity that is intrinsic to and cannot exist without the entity and is observable by a sensor, or operable by an actuator. 

On the other hand, a property may also itself be a feature of interest. For example if a fridge uses alternative current energy, then several aspects of its energy consumption property may be quantified. Examples of such aspects include:

- the active power consumption;
- the reactive power consumption;
- the phase of voltage relative to current;
- the frequency;
- the minimal operating value of the frequency;
- the number of occurences of unusual values.

These are different properties of the same property:

```
ex:activePower a owl:ObjectProperty ;
  rdfs:subPropertyOf seas:hasProperty ;
  rdfs:domain seas:PowerProperty ;
  rdfs:range seas:PowerProperty .

<fridge/1/consumption> a seas:FeatureOfInterest ;
  ex:activePower <fridge/1/consumption/activePower> .
```

Evaluations qualify the link [`seas:value`](https://w3id.org/seas/value). In particular, they may hold metadata about:

1. the type of evaluation;
2. the context of validity of the evaluation;
3. provenance information or any other data.
